(1, 'เราเติบโตขึ้นในทุกๆวัน', 'คิด มาก', 'เรื่องย่อ\r\nทุกช่วงชีวิตมีบทเรียน\r\nและทุกๆ บทเรียนทำให้เราเป็นเราในวันนี้\r\nข้อคิดและมุมมองที่ได้เรียนรู้จากแต่ละช่วงวัยของชีวิต\r\nแบ่งออกเป็น 3 พาร์ท ได้แก่ วัยนักเรียน วัยนักศึกษา และวัยทำงานที่จะทำให้ผู้อ่านได้ทบทวนตัวเอง และหวนนึกถึงอดีตอีกครั้งแต่ละช่วงวัยเราอาจค้นพบบทเรียนที่แตกต่างออกไป  หรือไม่บทเรียนในวันนั้นอาจนำมาใช้ได้กับชีวิตในตอนนี้\r\nผู้อ่านจะค้นพบข้อคิด บทเรียน รวมถึงความสุขเล็กๆที่เราอาจจะเคยก้าวผ่านในแต่ละช่วงวัย รวมถึงคิดถึงสิ่งที่เคยเกิดขึ้น ประสบการณ์ดีๆ รวมถึงผู้คนที่เคยอยู่ในชีวิตช่วงหนึ่ง', '', 0, 20, 100, 7);
