INSERT INTO `book_table` (`id_book`, `name_book`, `book_author`, `details`, `pic_book`, `status_book`, `price`, `price_book`, `category_id`) VALUES
(11, 'ใช้คลื่นพลังบวกดึงดูดพลังสุข', 'เว็กซ์ คิงส์', 'ใช้กฎแห่งแรงสั่นสะเทือนดึงดูดพลังงานบวกรอบตัว เพื่อบรรลุความสุขและเป้าหมายอันยิ่งใหญ่กว่าที่คุณคิดฝัน', '', 0, 20, 100, 7),
(12, 'แด่คุณที่กลัวการเปลี่ยนแปลงมาตลอดชีวิต (ฉ.เปลี่ยนปก)', 'Mentalist Daigo', '    Positive Change ที่จะช่วยให้คุณสนุกไปกับการเปลี่ยนแปลงคืออะไร “อยากเป็นคนที่มีความสามารถมากกว่านี้” “อยากทำอะไรสักอย่างเพื่อเปลี่ยนนิสัยแย่ ๆ นี้” “อยากเปลี่ยนแปลงตัวเอง อยากเป็นคนใหม่” โลกเรามีคนมากมายปรารถนาที่จะเปลี่ยนแปลงตัวเอง คุณหยิบหนังสือเล่มนี้ขึ้นมาก็คงเป็นหนึ่งในนั้น การใช้เวลาเพื่อเปลี่ยนแปลงตัวเอง เข้าใจ “สัดส่วนเวลา” ของตัวเอง ทำไมสตีฟ จ็อบส์ ถึงตื่นเช้า วิธีปลดปล่อย “ช่วงเวลาที่ทำให้กังวลง่ายที่สุด” ออกจากชีวิตคืออะไร ยิ่งไม่มีเวลายิ่งเปลี่ยนพฤติกรรมง่าย วิธี “10 เปอร์เซ็นต์” ที่ช่วยให้ทุกคนตื่นเช้าได้ วิธีเปลี่ยนการไปทำงานตอนเช้าให้เป็นบวก ถ้าเปลี่ยนเวลาไม่ได้ ลองเปลี่ยนวิธีใช้เวลาดู', '', 0, 20, 100, 12),
(14, 'ซึมเศร้า โรคยอดฮิตหรือแค่คิดไปเอง', 'ดร.เคที เฮอร์ลี่ย์', ' ความเครียดและอารมณ์บวกลบเป็นเรื่องปกติของการเติบโต แต่วัยรุ่นบางคนต้องต่อสู้ดิ้นรนและอาจประสบภาวะซึมเศร้าในช่วงวัยรุ่น อันที่จริง หนึ่งในห้าของวัยรุ่นจะเผชิญกับภาวะซึมเศร้า ณ จุดใดจุดหนึ่ง แม้ช่วงเวลาที่ประสบภาวะซึมเศร้าอาจร้ายแรงและน่ากลัว วัยรุ่นหลายคนที่แสดงอาการซึมเศร้าบางประการ และต้องการความช่วยเหลือเป็นพิเศษ แต่ไม่ได้รับการวินิจฉัยทางการแพทย์ว่าเป็นโรคซึมเศร้า เมื่อได้รับความช่วยเหลือที่ถูกต้อง วัยรุ่นสามารถเรียนรู้ที่จะรับมือกับภาวะซึมเศร้าของตัวเอง แล้วก็เอาชนะมันได้หนังสือ ซึมเศร้า โรคยอดฮิตหรือแค่คิดไปเอง แบ่งเนื้อหาออกเป็น\r\n   ภาคที่ 1 จะกล่าวถึงภาวะซึมเศร้าว่าคืออะไร มีอาการอะไรบ้าง และวิธีการต่างๆ ที่วัยรุ่นใช้รับมือกับภาวะนี้\r\n  ภาคที่ 2 เป็นกิจกรรมและแบบทดสอบที่จะช่วยให้คุณเข้าใจอาการของภาวะซึมเศร้าได้ดีขึ้น และค้นพบวิธีปรับความรู้สึกให้ดีขึ้น \r\n  ภาคที่ 3 จะพูดถึงปัญหาในชีวิตจริง และเสนอวิธีจัดการปัญหาเหล่านั้น\r\nหนังสือเล่มนี้เป็นบันทึกเกี่ยวกับภาวะซึมเศร้าที่ช่วยให้คุณจัดการกับอารมณ์ระหว่างพบนักบำบัดหรือแพทย์ ผลการวิจัยชี้ให้เห็นว่าการจดบันทึกช่วยบรรเทาความเครียดได้', '', 0, 20, 100, 12);
INSERT INTO `book_table` (`id_book`, `name_book`, `book_author`, `details`, `pic_book`, `status_book`, `price`, `price_book`, `category_id`) VALUES
(15, 'เทพมรณะสะบั้นเศียร เล่ม 7', 'ปิงหลินเสินเซี่ย', 'เทพมรณะสะบั้นเศียรแปล-เรียบเรียงจากตันฉบับภาษาจีนชื่อ ซื่อเหยินจิงซึ่งแปลตรงตัวว่า คัมภีร์คนตาย ที่น่าสนใจคือเรื่องนี้ย้ายสมรภูมิจากแผ่นดินจงหยวนมายังแคนซีอขี้หรือชายแคนตะวันตกซึ่งประกอบด้วยหน่วยงานนักฆ่า ค่ายพรรคโจรมิจฉาชีพตระกูลใหญ่อันดับหนึ่ง ตลอดจนขุมกำลังต่าง ๆตัวเอกของเรื่องประสบภัยถูกฆ่าล้างทั้งตระกูลจึงตั้งปณิธานคิดล้างแค้นหากทว่าตนเองตกอยู่ในห้วงคับข้นอันตรายกลายเป็นความกดคันอย่างสูงถือเป็นเรื่องจีนแนวกำลังกายในที่ห่างหายไปนานพอสมควรหวังเป็นอย่างยิ่งว่า เทพมรณะสะบั้นเศียรจะปลุกเร้าให้ท่านเลือดลมพลุ่งพล่านขึ้นมา', '', 0, 20, 100, 13),
(16, 'เทพมรณะสะบั้นเศียร เล่ม 6', 'ปิงหลินเสินเซี่ย', '-', '', 0, 20, 100, 13);
INSERT INTO `book_table` (`id_book`, `name_book`, `book_author`, `details`, `pic_book`, `status_book`, `price`, `price_book`, `category_id`) VALUES
(17, 'เทพมรณะสะบั้นเศียร เล่ม 5', 'ปิงหลินเสินเซี่ย', '  เทพมรณะสะขั้นเศียรแปล-เรียบเรียงจากตันฉบับกาษาจีนชื่อ ซื่อเหยินจิงซึ่งแปลตรงตัวว่า คัมภีร์คนตาย ที่น่าสนใจคือเรื่องนี้ย้ายสมรภูมิจากแผ่นดินจงหยวนมายังแดนซีอวี้หรือชายแดนตะวันตกซึ่งประกอบด้วยหน่วยงานนักฆ่า ค่ายพรรคโจรมิจฉาชีพตระกูลใหญ่อันดับหนึ่ง ตลอดจนขุมกำลังต่าง ๆตัวเอกของเรื่องประสบกัยถูกฆ่าล้างทั้งตระกูลจึงตั้งปณิธานคิดล้างแค้นหากทว่าตนเองตกอยู่ในห้วงคับข้นอันตรายกลายเป็นความกดคันอย่างสูงถือเป็นเรื่องจีนแนวกำลังกายในที่ห่างหายไปนานพอสมควรหวังเป็นอย่างยิ่งว่า เทพมรณะสะบั้นเศียรจะปลุกเร้าให้ท่านเลือดลมพลุ่งพล่านขึ้นมา', '', 0, 20, 100, 13),
(18, 'เทพมรณะสะบั้นเศียร เล่ม 4', 'ปิงหลินเสินเซี่ย', '  เทพมรณะสะบั้นเศียร แปล เรียบเรียงจากต้นฉบับภาษาจีนชื่อ ซื่อเหยินจิง ซึ่งแปลตรงตัวว่า คัมภีร์คนตาย ที่น่าสนใจคือ เรื่องนี้ย้ายสมรภูมิจากแผ่นดินจงหยวนมายังแดนซีอขี้หรือชายแดนตะวันตกซึ่งประกอบด้วยหน่วยงานนักฆ่า ค่ายพรรคโจรมิจฉาชีพ ตระกูลใหญ่อันดับหนึ่ง ตลอดจนขุมกำลังต่างๆตัวเอกของเรื่องประสบภัยถูกฆ่าล้างทั้งตระกูล จึงตั้งปณิธานคิดล้างแค้นหาก ทว่าตนเองตกอยู่ในห้วงคับข้นอันตราย กลายเป็นความกดค้นอย่างสูง ถือเป็นเรื่องจีนแนวกำลังกายในที่ห่างหายไปนานพอสมควรหวังเป็นอย่างยิ่งว่า เทพมรณะสะบั้นเศียรจะปลุกเร้าให้ท่านเลือดลมพลุ่งพล่านขึ้นมา', '', 0, 20, 100, 13);

